import React from "react";
import images from "../utilities/images";
import Card from "../Card";

const Gallery = ({ page }) => {
  console.log("from gallery", page);
  let gallery = images.page.map(image => (
    <Card src={`../images/${page}/${image}`} />
  ));
  return gallery;
};

export default Gallery;
